// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Ballot {

    string public message;

    uint voterCount = 0;
    uint voteCount = 0;
    uint candidateCount = 0;
    uint private countResult = 0;
    address public officialAddress;
    string public officialName;    
    
    //consider replacing string with byte 32
    struct voter{
        string voterName;
        //uint voterID;
        bool hasVoted;
    }
       
    struct candidate{
        string office;
        string candidateName;
        string party;
        uint cID;
    }

    struct vote{
        address voterAddress;
        candidate president;
        candidate house;
        candidate senate;
    }
    
    mapping (uint => candidate) candidates;
    mapping (uint => vote) private votes;
    mapping (address => voter) voterRegistry;
    
    enum State { Created, Voting, Ended }
    State public state;

    //MODIFIERS
    modifier condition(bool _condition) {
        require((_condition));
        _;
    }

    modifier officialOnly() {
        require(msg.sender == officialAddress);
        _;
    }

    modifier inState(State _state) {
        require(state == _state);
        _;
    }

    //FUNCTIONS
    constructor(string memory _message, string memory _officialName) public  {
        message = _message;
        officialName = _officialName;
        officialAddress = msg.sender;

        state = State.Created;
        uint cID = candidateCount++;
        candidates[cID] = candidate("President", "Calvin Coolidge", "Republican", cID); 

        cID = candidateCount++;
        candidates[cID] = candidate("President", "John W Davis", "Democrat", cID); 
    }
    
    function registerVoter(address _voterAddress, string memory _voterName) public inState(State.Created) officialOnly{
        voter memory v;
        v.voterName = _voterName;
        v.hasVoted = false;
        voterRegistry[_voterAddress] = v;
        voterCount++;
    }

    function openPoll() public inState(State.Created) officialOnly {
        state = State.Voting;
    }

    function closePoll() public inState(State.Voting) officialOnly {
        state = State.Ended;
        
    }

    function writeIn(string memory office, string memory name, string memory party) public {
        
        uint cID = candidateCount++;
        candidates[cID] = candidate(office, name, party, cID);
        
        //bool candidateExist = false;
        
        //move to top
        //for (uint i = 0, i < candidateCount, i++){
        //if candidates[i].name == name
        //candidateExist = true
        //submitVote(uint voterID, uint cID);
        //}
        
        //if(candidateExist = false){
            //add candidate
        //}
        
    }
    
    function submitVote(uint cID) public  inState(State.Voting) returns (bool){
        bool found = false;
        
        //make sure voter exists and has not voted
        if(bytes(voterRegistry[msg.sender].voterName).length != 0
        && !voterRegistry[msg.sender].hasVoted){
            vote memory v;
            v.voterAddress = msg.sender;
            v.president = candidates[cID];
            v.house = candidates[cID];
            v.senate = candidates[cID];
            votes[voteCount] = v;
            voteCount++;
            found = true;
            voterRegistry[msg.sender].hasVoted = true;
            emit voteSubmitted();
        }
            return found;
    }
    
    
    //view function are read-only, good for "getters"
    function getVoteCount(uint cID) view public returns(uint) {
        
        uint result = 0;
        
        for (uint i = 0; i < voterCount; i++) {
            if (votes[i].president.cID == cID) {
                result++;
            }
        }
        
        return result;
    }

    function test() public returns(string memory){
        emit testEvent();
      return message;
   }

   function set(string memory _message) public {
       message = _message;
   }

   event voteSubmitted();

   event testEvent();
    
}
